    leisure


      (select way,aeroway,amenity,landuse,leisure,man_made,military,"natural",power,tourism,name
       from &prefix;_polygon
       where landuse is not null
          or leisure is not null
          or aeroway in ('apron','aerodrome')
          or man_made='pier'
          or amenity in ('parking','university','college','school','hospital','grave_yard')
          or military in ('barracks','danger_area')
          or "natural" in ('field','beach','glacier','heath','mud','wood')
          or power in ('station','sub_station')
          or tourism in ('attraction','camp_site','caravan_site','picnic_site','zoo')
       order by z_order,way_area desc
      ) as leisure

      &datasource-settings;



    sports_grounds

      (select way,leisure from &prefix;_polygon where leisure in ('sports_centre','stadium') order by z_order,way_area desc) as sports_grounds
      &datasource-settings;



    water_areas

      (select way,"natural",waterway,landuse,name from &prefix;_polygon where waterway in ('dock','mill_pond','riverbank','canal') or landuse in ('reservoir','water') or "natural" in ('lake','water','land','marsh','scrub','wetland','glacier') order by z_order,way_area desc) as water_areas
      &datasource-settings;



